import React, { useState } from "react";
import { Home, Posts } from "./components";
import { Route, Switch, Link } from "react-router-dom";
import { fetchPosts } from "./api/api";

const App = () => {
  const [posts, setPosts] = useState([]);

  return (
    <div>
      <nav>
        <Link to="/">Home</Link>
        <Link to="/Posts">Posts</Link>
      </nav>
      <Switch>
        <Route exact path="/">
          <Home />
        </Route>
        <Route path="/Posts">
          <Posts />
        </Route>
      </Switch>
    </div>
  );
};

export default App;
